def suggest_events(interests, goals):
    """"""
    events = {'TechCrunch Disrupt': ['tech', 'entrepreneurship'], 'CES': ['tech', 'innovation'], 'Google I/O': ['tech', 'development'], 'South by Southwest': ['entrepreneurship', 'marketing'], 'TED Conferences': ['inspiration', 'leadership'], 'World Economic Forum': ['economics', 'politics']}
    recommended_events = []
    for (event, event_interests) in events.items():
        if any((interest in event_interests for interest in interests + goals)):
            recommended_events.append(event)
    return recommended_events
